import "./App.css";
import {
    BrowserRouter as Router,
    Routes,
    Route,
    Navigate,
} from "react-router-dom";
//import Chess from "./components/Chess";
import Chess from "./pages/Chess";
import RoomJoin from "./pages/RoomJoin";

function App() {
    return (
        <>
            <Router>
                <Routes>
                    <Route path="/" element={<Navigate replace to="/home" />} />

                    <Route path="/home" exact element={<RoomJoin />} />
                    <Route
                        //path="/play/[0-9]+/\?&choice=(White|Black)"
                        path="/play/[0-9]+"
                        exact
                        element={<Chess />}
                    />
                </Routes>
            </Router>
        </>
    );
}

export default App;
